import React from 'react'

const AddCampaignForm = () => {
    return (
        <div>
            <form>
                <input name='name' />
                <input type='hidden' />
                <input type='submit' value = 'Create Campaign' />
            </form>
        </div>
    )
}

export default AddCampaignForm
